import './App.css';
import Header from './components/Header';
import StudentInfo from './components/StudentInfo';
import Dashboard from './components/Dashboard';

function App() {
  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <StudentInfo />
        <Dashboard />
      </main>
    </div>
  );
}

export default App;
